import * as React from 'react';
import { Button, Image, View, Text, ScrollView, StyleSheet} from 'react-native';

export default class HomeScreen extends React.Component {
	render(){
		return(
            <ScrollView>
                <View style={styles.Welcome_Text}>
                    <Image
                        style = {styles.Aily_Logo}
                        source = {require('../assets/10.png')}
                    />

                    <Text> WELCOME TO AILY </Text>  
                <View style={styles.Log_In_Button}>
                    <Button
                        title="Log In"
                        onPress={() => this.props.navigation.navigate("Login")}
                    />
                <View style={styles.Sign_Up_Button}>
                    <Button
                        title="Sign Up"
                        onPress={() => this.props.navigation.navigate("SignUp")}
                    />
                
                </View>  
                </View>
                </View>
            </ScrollView>
		)
	}
}

const styles = StyleSheet.create({
    Aily_Logo: {
        width: 206,
        height: 104
    },
    Welcome_Text: {
        flex: 1, 
        alignItems: 'center',
        padding: 20,
        marginTop: 200,
        marginBottom: 100
    },
    Log_In_Button: {
        flex: 1,
        justifyContent: 'center',
        marginTop: 40,
        marginBottom: 20
    },
    Sign_Up_Button: {
        flex: 1,
        justifyContent: 'center',
        marginTop: 40,
        marginBottom: 40
    }
});
